import "./index.css";
import RefundPage from "./Pages/RefundPage";
import Header from "./Header/Header";
import Nav from "./Header/Nav";

function App() {
	return (
		<div>
			<Routes>
				<Route path="/" element={<HomePage />} />

				<Route path="/RefundPage" element={<RefundPage />} />
			</Routes>
			<Nav />
			{/* <Header /> */}
			<RefundPage />
		</div>
	);
}

export default App;
